DROP TABLE IF EXISTS `v_commission_record`;
CREATE TABLE `v_commission_record`  (
  `commission_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '提成id',
  `order_date` date NOT NULL COMMENT '出库日期/业务日期',
  `receive_bill_no` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '应收单-单据编号',
  `sales_bill_no` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '销售出库-单据编号',
  `sales_order_bill_no` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '销售订单',
  `f_sales_bill_no` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '发货通知单',
  `customer_id` bigint(20) NOT NULL COMMENT '客户id',
  `salesperson_id` bigint(20) NULL DEFAULT NULL COMMENT '业务员id',
  `salesperson_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '业务员名称',
  `current_salesperson_level_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '业务员级别名称',
  `current_salesperson_level_rate` decimal(4, 3) NOT NULL COMMENT '业务员级别系数',
  `current_parent_id` bigint(20) NULL DEFAULT NULL COMMENT '当时上级id',
  `current_parent_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '上级名称',
  `current_parent_level_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '上级级别名称',
  `current_parent_level_rate` decimal(4, 3) NULL DEFAULT NULL COMMENT '上级级别系数',
  `sales_amount` decimal(10, 3) NULL DEFAULT NULL COMMENT '销售金额（税价合计）',
  `exchange_rate` decimal(10, 6) NULL DEFAULT NULL COMMENT '汇率',
  `fall_amount` decimal(12, 3) NULL DEFAULT NULL COMMENT '税价合计（人民币）',
  `currency_type` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '币别',
  `customer_year` int(11) NULL DEFAULT NULL COMMENT '客户合作年数',
  `customer_year_rate` decimal(4, 3) NOT NULL COMMENT '客户年份系数',
  `commission_type` tinyint(3) NOT NULL COMMENT '提成类型(1业务提成 2管理提成)',
  `commission_rate` decimal(5, 4) NOT NULL COMMENT '提成系数',
  `commission_amount` decimal(13, 7) NULL DEFAULT NULL COMMENT '提成金额',
  `is_transfer` tinyint(3) NOT NULL COMMENT '是否为转交(0非转交 1转交',
  `is_customs_declaration` tinyint(3) NOT NULL COMMENT '客户是否报关(0客户不报关 1客户报关)',
  `create_time` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`commission_id`) USING BTREE,
  UNIQUE INDEX `sales_bill_no_commision`(`sales_bill_no`, `commission_type`) USING BTREE,
  INDEX `order_date`(`order_date`) USING BTREE,
  INDEX `customer_id`(`customer_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 63241 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = DYNAMIC;

