-- ----------------------------
-- Triggers structure for table v_commission_record
-- ----------------------------
DROP TRIGGER IF EXISTS `add_`;
delimiter ;;
CREATE TRIGGER `add_` AFTER INSERT ON `v_commission_record` FOR EACH ROW BEGIN
    UPDATE v_sales_outbound
    SET commission_flag = 1
    WHERE bill_no = NEW.sales_bill_no;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table v_commission_record
-- ----------------------------
DROP TRIGGER IF EXISTS `delete_commission`;
delimiter ;;
CREATE TRIGGER `delete_commission` AFTER DELETE ON `v_commission_record` FOR EACH ROW BEGIN
    UPDATE v_sales_outbound
    SET commission_flag = 0
    WHERE bill_no = OLD.sales_bill_no;  
END
;;
delimiter ;

